const html = $input.first().json.data;

const splittedHTML = html.split('"captions":');
if (splittedHTML.length <= 1) {
  if (html.includes('class="g-recaptcha"')) {
    return { success: false, error: "Too Many Requests" }
  }
  if (!html.includes('"playabilityStatus":')) {
    return { success: false, error: "Transcript unavailable 1" }
  }
  return { success: false, error: "Transcript disabled " }
}

const captions = (() => {
  try {
    return JSON.parse(
      splittedHTML[1].split(',"videoDetails')[0].replace('\n', '')
    );
  } catch (e) {
    return undefined;
  }
})()?.['playerCaptionsTracklistRenderer'];

if (!captions) {
  return { success: false, error: "Transcript disabled " }
}

if (!('captionTracks' in captions)) {
  return { success: false, error: "Transcript not available 2" }
}

const transcriptUrl = captions.captionTracks[0].baseUrl

return { success: true, transcriptUrl, video_id: $ }
